  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0130917 contains raw underway
  meteorological, navigational, physical and time series data logged by the Scientific
  Computer System (SCS) aboard the NOAA Ship Nancy Foster in the North Atlantic Ocean
  from 2015-08-09 to 2015-08-16. Office of Marine and Aviation Operations (OMAO) personnel
  aboard the ship submitted these data and associated metadata to NODC. In addition,
  NODC Accession 0130917 contains supplementary cruise-level metadata, which OMAO
  personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NODC personnel
  developed the automated process to archive these data under the auspices of the
  NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
